import React from "react";

// import image
import landingImg from "../img/landingImg.jpg";

// import materia-ui components
import { makeStyles } from "@material-ui/core/styles";
import { Box, Grid } from "@material-ui/core";

// custom css styling
const useStyles = makeStyles({
  coverImg: {
    height: "100vh",
    width: "100vw",
    backgroundImage: `url(${landingImg})`
  },
  textWhite: {
    color: "white"
  },
  linkText: {
      color: "white",
      fontSize: "20px",
      textDecoration: "none"
  }
});

function Front() {
  const classes = useStyles();

  return (
    <>
      <div className={classes.coverImg}>
        <Box
          justifyContent="center"
          alignItems="center"
          display="flex"
          flexDirection="column"
          style={{ height: "100vh" }}
          bgcolor="text.disabled"
        >
          <Box textAlign="center" style={{width: "35vw"}}>
            <h1 style={{ fontSize: "70px" }} className={classes.textWhite}>
              Jay Kim
            </h1>
            <p style={{ fontSize: "30px" }} className={classes.textWhite}>
              Full Stack Developer
            </p>
            <hr style={{backgroundColor: "white"}}></hr>
            <Grid container direction="row" justify="center" alignItems="center" spacing={5}>
            <Grid item xs>
              <a href="#about" className={classes.linkText}>About</a>
            </Grid>
            <Grid item xs>
              <a href="#projects" className={classes.linkText}>Projects</a>
            </Grid>
            <Grid item xs>
              <a href="#contact" className={classes.linkText}>Contact</a>
            </Grid>
          </Grid>
          </Box>
        </Box>
      </div>
    </>
  );
}

export default Front;
